drop database if exists library;
create database library;
use library;
create table books (isbn int,title varchar(100),author varchar(100),publisher varchar(100), published datetime, primary key (isbn));
create table lenders (id int, fname varchar(100),lname varchar(100),address varchar(100),primary key (id));
create table copies (isbn int,exnum int, primary key (exnum,isbn), constraint foreign key (isbn) references books(isbn));
create table loans (loanid int,id int not null,isbn int not null,exnum int not null,leasedate datetime not null,delivered boolean,primary key (loanid),constraint foreign key (isbn) references books(isbn),constraint foreign key (exnum) references copies(exnum),foreign key (id) references lenders(id));
